import React from "react";
import {LessDetailedAtomicElement, MoreDetailedAtomicElement} from "./ElementRepresentation";


class PeriodicTable extends React.Component {
    constructor(props) {
        super(props);
    }

    _createElementTable() {
		let json = new DOMParse().parseFromString(this.props.xmlData);
		let grid = new Array(10).fill(null).map(() => new Array(18).fill(null));

        for (let key in json) {
            let rowIndex = json[key].row;
            let columnIndex = json[key].column;

            grid[rowIndex][columnIndex] = (
                <div>
                    <LessDetailedAtomicElement symbol={json[key].symbol} type={json[key].type} atomicNumber={json[key].atomicNumber} />
                </div>
            );
        }
    }

    render() {
        let elementTable = this._createElementTable();
		
		
        return (
            <div>
                Hi
            </div>
        );
    }
}

export default PeriodicTable
